import React from "react";

function Dropdownmenu(props) {
  const pageNoArr = props.props;

  return (
    <>
      <div className="dropdown">
        <div className="menu"></div>
        {pageNoArr.map((elem) => (
          <div
            onClick={(e) => {
              props.onDelete(e, elem);
            }}
          >
            {}
          </div>
        ))}
      </div>
    </>
  );
}
export default Dropdownmenu;
